type ShapeStyle = {
  width: string;
  height: string;
  borderRadius: string;
};


export const SHAPES: Record<string, ShapeStyle> = {
    rectangle: {
      width: '100px',
      height: '50px',
      borderRadius: '0'
    },
    circle: {
      width: '50px',
      height: '50px',
      borderRadius: '50%'
    },
    vector: {
      width: '70px',
      height: '70px',
      borderRadius: '0'
    }
    
  };
